era-<br />\nção)<br />\nAgente-Mor: O corpo dele está bem suado <br />\n– agora despeje o balde dágua encima pra <br />\ncorrente pegar melhor. <br />\nAgente Loira Babalorixá de Umbanda: 26 <br />\nminutos<br />\nAgente-Mor: Apresento o meu advogado <br />\nDr. Smith Wesson calibre 3 oitão. <br />\nMarujeiro da Lua (com ufanismo revista <br />\ntexto – FA – TAL –): Me sinto possuidor <br />\ndalguma coisa INDESTRUTÍVEL dentro <br />\nde mim<br />\nAÇÃO: Marujeiro da Lua é desamarrado da <br />\nvara/ colocado no chão donde não conse-<br />\ngue se levantar/ seus pés formigam/ tenta se <br />\nlevantar/ sente que vai desmaiar/ se susten-<br />\nta/ encaminha-se até a frente diz a supra <br />\núltima deixa do personagem Marujeiro da <br />\nLua e FIM<br />\nAVISO AOS SRS. ESPECTADORES:<br />\n\"A Medida do Homem\" não pode fugir a este<br />\nfinal idealista em homenagem aos avós<br />\nClaudel-Zdanov.<br />\nNesta cidade fundada por abnegados jesuítas,<br />\nSão Paulo novembro 72<br />\nDelegacia do 4º Distrito<br /><br />\nSem testemunhas<br />\nWALYSAILORMOON',NULL,NULL,NULL,NULL,NULL,''),(397,23,380,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(398,24,381,159,'159',NULL,NULL,NULL,NULL,NULL,''),(399,26,382,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(400,27,382,200,'200',NULL,NULL,NULL,NULL,NULL,''),(401,22,383,NULL,'REITORIA...<br />\n– A dependência de instituições é limitadora. Elas são uma espécie de pai; ajudam materialmente, mas limitam muito. Hoje, a gente vê indivíduos que só funcionam em função da instituição. Então, a gente começa a questionar a validez da instituição, a criar um trabalho paralelo, marginal, que resulta sempre mais interessante. Um trabalho desamparado, mas criativo. A instituição exige coisas \"de acordo\", coisas que \"não venham ao encontro\", e um trabalho marginal é mais livre.<br /><br />\n– A dependência de instituições é limitadora. Elas são uma espécie de pai; ajudam materialmente, mas limitam muito. Hoje, a gente vê indivíduos que só funcionam em função da instituição. Então, a gente começa a questionar a validez da instituição, a criar um trabalho paralelo, marginal, que resulta sempre mais interessante. Um trabalho desamparado, mas criativo. A instituição exige coisas \"de acordo\", coisas que \"não venham ao encontro\", e um trabalho marginal é mais livre.',NULL,NULL,NULL,NULL,NULL,''),(402,23,384,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(403,24,385,159,'159',NULL,NULL,NULL,NULL,NULL,''),(404,26,386,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(405,27,386,200,'200',NULL,NULL,NULL,NULL,NULL,''),(406,22,387,NULL,'– As apresentações na Reitoria deram muitas coisas. Quando eu cheguei na Bahia, em 69, uma apresentação na Reitoria suscitava discussões. Com o tempo, com os prêmios internacionais, tudo foi aceito, incorporado, e o público diz \"amém\". Ninguém questiona. E quando as coisas se acomodam, há algo errado.<br />\n– Há formas de você questionar uma coisa, destruir uma coisa, criar uma coisa paralela que anule a primeira. Evidente que a Reitoria ainda é importante pra muita gente. Ninguém muda da noite pro dia. Particularmente, pra mim, é um tipo de apresentação superada, não me estimula. Ela impede que as coisas saiam de um determinado círculo.<br />\n– É preciso estender a um público maior os problemas. Esse passo deveria ser dado. Há um tempo atrás, se discutiu, mas não se fez nada… Apresentações em vários lugares, descentralizar. Isto é, se expor novamente, continuar se expondo. Não é todo artista que compreende que sua ação, sua função, é um contínuo se expor. As pessoas querem estar seguras, essa necessidade de estar seguro, garantido, esse medo… E a proposta de estar se expondo sempre não convence todo mundo. Há uma tendência, quer dizer, as coisas têm um movimento e param, estacionam e se equilibram. As pessoas pensam: bom, se escapei até aqui, vamos ficar por aqui mesmo. A coisa fica difícil. A inquietude, a busca do que está faltando, do que não está funcionando, acaba sendo surpreendente.',NULL,NULL,NULL,NULL,NULL,''),(407,23,388,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(408,24,389,159,'159',NULL,NULL,NULL,NULL,NULL,''),(409,26,390,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(410,27,390,200,'200',NULL,NULL,NULL,NULL,NULL,''),(411,22,391,NULL,'ONIRAK...<br />\n– “Onirak\" nasceu junto com o \"Octeto\". Eu comecei a elaborar um trabalho para ser desenvolvido pelo \"Octeto\". Juntar um músico, um dançarino, um coreógrafo, um cineasta, e trabalhar juntos. Eu precisava chegar a um trabalho mais apurado, mais integrado com outras artes, porque hoje a gente deve lançar mão de vários recursos expressivos, artes integradas, novas linguagens. Tenho feito isso desde \"Antístrofe\" – convidei artistas de vários gêneros para trabalhar, dentro de um esquema elaborado por mim, com a maior liberdade possível. \"Antístrofe\" tinha um roteiro com certos elementos estruturais, o resto não era fixo, ia se formando no processo. Mas o músico, por exemplo, entendia apenas a sua parte. O elemento de expressão corporal só cuidava de sua parte, etc. Eu queria aprofundar mais o trabalho. Precisava reduzir o número de pessoas, e intensificar mais. Aí nasceu o \"Octeto\", e começamos a buscar uma expressão integrada.<br />\n– Comecei a produzir material para o \"Octeto\" trabalhar. Se discutia, se experimentava o material. Surgiram problemas, como o de determinada estrutura sonora precisar ser interpretada por um movimento. Bem, quando se aplicava o movimento, a parte sonora caía. Quando a parte sonora estava bem, caía o movimento. E a gente começou a trabalhar em técnica de movimento, técnica vocal e se discutia o problema visual. Problemas de dança, música, artes plásticas – artes integradas. O músico ficava sabendo porque determinada solução visual era esta e não outra, etc. Em certo momento, comecei a conceber a organização de \"Onirak\". Fui criando uma estrutura aberta, e propondo alguns pontos fixos nessa estrutura. A partir da discussão, os pontos iam sendo introduzidos. Aí já pensávamos em apresentar o trabalho ao público.<br />\n– Nós trabalhamos muito para dominar os materiais dessa estrutura. O espontâneo se dá de duas formas. Ou é o acaso, ou é o resultado de um processo, uma disciplina. Eu escolhi o caminho da disciplina. Depois, comecei a elaborar a partitura, o desenho gráfico do que estava acontecendo. A partitura é o reflexo de um estágio do trabalho. Com o desenvolvimento desse trabalho, muitos pontos se alteraram. Integramos mais elementos, como a parte de cinema, que é uma espécie de cenário móvel, dinâmico, elaborado sobre a estrutura da peça, que funcionava como ponto de partida. A parte espacial depende das condições do local em que a gente for se apresentar.<br />\n– A gente queria que o público participasse ativamente, e tudo foi planejado em função dessa participação. A estrutura não era linear, não havia uma estória. Havia o personagem, mas ele era apenas um elemento, um estímulo, para que as coisas acontecessem. O resultado foi satisfatório. Fizemos três apresentações em São Paulo e aconteceu exatamente o previsto. No final de cada apresentação, a gente começou a dar elementos ao público, e foi passando do palco pra platéia. ',NULL,NULL,NULL,NULL,NULL,''),(412,23,392,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(413,24,393,159,'159',NULL,NULL,NULL,NULL,NULL,''),(414,26,394,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(415,27,394,200,'200',NULL,NULL,NULL,NULL,NULL,''),(416,22,395,NULL,'O público começava a cantar um uníssono que a gente dava, e ia improvisando. Eu passava um uníssono pra você, você pra ele, etc., e em poucos minutos a plateia inteira estava cantando. Então, a gente distribuía flautas de bambu, que são muito simples, qualquer um tira um som. Os que receberam flautas tiravam sons e a plateia acompanhava. Passaram do uníssono para outro som. A plateia inteira improvisando, cantando, era aquela massa sonora, acordes incríveis. Eu pensei que quando o filme acabasse ia acabar o improviso, mas o filme acabou, o palco iluminado, a gente no meio do público, e o improviso continuou. A mais longa improvisação que eu já vi. Quando acabou, começaram os papos: grupos conversando sobre o acontecimento. Nas três noites, os funcionários nos expulsaram para fechar o teatro. Apagaram as luzes, fizeram grosserias, enxotaram o público. Eu fiquei retado, mas o resultado foi satisfatório.<br />\n– Na primeira noite, a gente propôs um ensaio, quer dizer, não era bem um ensaio, era a apresentação do material, um acontecimento. Eu queria um entrosamento com o público e teve gente que se ofendeu, protestou, disse que tinha pago ingresso, que aquilo era frescura, etc. Nós estávamos mostrando nossos problemas de trabalho, mas as pessoas queriam o mistério. Mas a maioria do público foi favorável e deu dicas aproveitáveis quanto à iluminação, à parte sonora, etc. A gente estava testando as coisas com o público, e ele comentava. Uma menina se levantou na plateia e falou durante uns dez minutos. Disse que as pessoas tinham vindo ver uma obra, ver passivamente, e o que estava acontecendo exigia participação, não era uma coisa imposta, reciprocamente imposta, de o artista dizer e o público ouvir, do público pagar e exigir que o artista fale, faça sua \"magia\" e tal e se submeta ao público que paga para ver a \"magia\", etc.<br />\n– Quando falo \"artes integradas\" não estou me referindo à fusão de todas as artes, mas que o artista deve lançar mão de todos os recursos necessários, sem deixar de usar determinado recurso só porque ele pertence a outra área artística.<br />\n– Três críticos de revistas especializadas escreveram sobre \"Onirak\". Escreveram coisas tão ridículas, tão engraçadas... As pessoas têm uma coisa de segurança. Se entendem de estética, se apegam ao que sabem, se seguram nisso, querem uma estética eterna, mas a estética é relativa. Esse negócio que você falou do Décio Pignatari. Ele é muito agudo nessas questões ... a estética deve ser transitória.<br />\nSMETAK &amp; WIDMER…<br />\n– Smetak é um indivíduo muito amplo. Acho que o que há de mais importante no trabalho de Smetak é ele mesmo. Há momentos em que você tem que reconhecer a importância de Smetak. Em outros momentos, você tem de negar tudo que ele diz. Ele é muito contraditório. O disco que ele acabou de gravar é uma contradição. Smetak quer organizar uma elite de indivíduos escolhidos, indivíduos de alta percepção, inclusive extra-sensorial, para estudar. E agora parte para o oposto, faz um disco, se lança no consumo…<br />\n– Vocês criticam muito Widmer, acham que o que ele faz já foi feito há vinte anos, acham que Widmer não interessa, etc. Eu gostaria que vocês falassem essas coisas pra ele, isso de vanguarda estabelecida. Eu queria que vocês conversassem com ele. Eu converso muito com Widmer, discuto com ele. Quando faço um trabalho, mostro a ele, que me mostra os dele. E a gente tem discutido isso. Aceito a crítica no fundamental. Não posso negar que esses elementos já são comuns, e até convencionais. Concordo… mas também não tenho condição de me improvisar de crítico. Widmer é um grande músico, tem muito talento, muita sensibilidade, e é um cara aberto. É uma pessoa humana valiosa. Eu falo pra ele: \"mas, Widmer, pra que o tema, sempre o tema?\" E ele: \"não consigo me expressar sem o tema, é uma coisa que está dentro de mim, se tiro o tema; não me expresso sinceramente\". É difícil…<br />\nGRAND-FINALE...<br />\n– Bom,   gente,   agora   eu   tenho  que  me picar…',NULL,NULL,NULL,NULL,NULL,''),(417,23,396,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(418,24,397,159,'159',NULL,NULL,NULL,NULL,NULL,''),(419,26,398,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(420,27,398,200,'200',NULL,NULL,NULL,NULL,NULL,''),(421,22,399,NULL,'<br />\nAND/OR<br /><br />\nAND/OR<br /><br />\nANDROGYNOUS',NULL,NULL,NULL,NULL,NULL,''),(422,23,400,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(423,24,401,159,'159',NULL,NULL,NULL,NULL,NULL,''),(424,26,402,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(425,27,402,200,'200',NULL,NULL,NU